import styled from 'styled-components';

import Navbar from '../../components/shared/Navbar';
import FileUploadForm from './components/FileuploadForm';

const SplitScreenLayout = styled.div`
  display: flex;
  & > * {
    width: 50%;
  }
`;

const Home = () => (
  <div>
    <Navbar />
    <SplitScreenLayout>
      <FileUploadForm />
      <p>dddd</p>
    </SplitScreenLayout>
  </div>
);

export default Home;
